import {
    CompositionsContainer,
    HomeContainer, SuggestFormContainer, SuggestFormSucceed
} from "../views/pages";


const routes = [
    {
        path: '/',
        exact: true,
        auth: false,
        component: HomeContainer
    },
    {
        path: '/suggest',
        exact: true,
        auth: true,
        component: SuggestFormContainer
    },
    {
        path: '/suggest/success',
        exact: true,
        auth: true,
        component: SuggestFormSucceed
    },
    {
        path: '/compositions(/:page?)',
        exact: true,
        auth: false,
        component: CompositionsContainer
    },
    // {
    //     path: '/showcase/:id',
    //     exact: false,
    //     auth: true,
    //     component: ShowcaseContainer
    // },
    // {
    //     path: '/order/:id',
    //     exact: true,
    //     auth: true,
    //     component: OrderFormContainer
    // },
    // {
    //     path: '/order/:id/success',
    //     exact: false,
    //     auth: true,
    //     component: OrderFormSucceed
    // },
    // {
    //     path: '*',
    //     exact: true,
    //     auth: false,
    //     component: ErrorPage
    // }
];

export default routes;
